+
+/**
+ * Class SocialNetworkLinkCrawlObserver
+ * @package DigitalVisibilityIndex\CrawlObserver
+ */
+class SocialNetworkLinkCrawlObserver extends CrawlObserver
+{
+    /**
+     * @var Storage
+     */
+    private $storage;
+
+    /**
+     * @var array
+     */
+    private $socialNetworkLinks;
+
+    /**
+     * SocialNetworkLinkCrawlObserver constructor.
+     * @param Storage $storage
+     */
+    public function __construct(Storage $storage)
+    {
+        $this->storage = $storage;
+        $this->socialNetworkLinks = [];
+    }
+
+    /**
+     * @param UriInterface $url
+     * @param ResponseInterface $response
+     * @param UriInterface|null $foundOnUrl
+     */
+    public function crawled(
+        UriInterface $url,
+        ResponseInterface $response,
+        ?UriInterface $foundOnUrl = null
+    ) {
+        $crawler = new Crawler((string)$response->getBody());
+
+        $xPath = "//a["
+            . "contains(@href, 'facebook.com') or "
+            . "contains(@href, 'twitter.com') or "
+            . "contains(@href, 'instagram.com'"
+            . ")]";
+
+        $socialNetworkLinks = $crawler->filterXPath($xPath)
+            ->each(function (Crawler $node) {
+                return $node->attr("href");
+            });
+
+        foreach ($socialNetworkLinks as $link) {
+            if (!in_array($link, $this->socialNetworkLinks)) {
+                array_push($this->socialNetworkLinks, $link);
+            }
+        }
+    }
+
+    /**
+     * @param UriInterface $url
+     * @param RequestException $requestException
+     * @param UriInterface|null $foundOnUrl
+     */
+    public function crawlFailed(
+        UriInterface $url,
+        RequestException $requestException,
+        ?UriInterface $foundOnUrl = null
+    ) {
+    }
+
+    /**
+     * Called when the crawl has ended.
+     */
+    public function finishedCrawling()
+    {
+        $this->storage->setValue('socialNetworkLinks', $this->socialNetworkLinks);
+    }
+}

