+
+/**
+ * Class QuantityOfContentsCrawlObserver
+ * @package DigitalVisibilityIndex\CrawlObserver
+ */
+class QuantityOfContentsCrawlObserver extends CrawlObserver
+{
+    /**
+     * @var Storage
+     */
+    private $storage;
+
+    /**
+     * @var array
+     */
+    private $sizeOfPageTree;
+    private $quantityOfWords;
+
+    /**
+     * EmailAddressesCrawlObserver constructor.
+     * @param Storage $storage
+     */
+    public function __construct(Storage $storage)
+    {
+        $this->storage = $storage;
+        $this->sizeOfPageTree = [];
+        $this->quantityOfWords = [];
+    }
+
+    /**
+     * @param UriInterface $url
+     * @param ResponseInterface $response
+     * @param UriInterface|null $foundOnUrl
+     */
+    public function crawled(
+        UriInterface $url,
+        ResponseInterface $response,
+        ?UriInterface $foundOnUrl = null
+    ) {
+        $html = Helper::tidyHtml((string)$response->getBody());
+
+        $pattern = '/(<[^\/]\s*[^>]*>)/i';
+        preg_match_all($pattern, $html, $matches);
+
+        array_push($this->sizeOfPageTree, count($matches[0]));
+
+        $pattern = '/(.*)/i';
+        preg_match_all($pattern, $html, $matches);
+        $word_count = 0;
+        foreach ($matches[0] as $words) {
+            $words = str_word_count(trim(strip_tags($words)));
+            if(!empty($words)) {
+                $word_count += $words;
+            }
+        }
+        array_push($this->quantityOfWords, $word_count);
+    }
+
+    /**
+     * @param UriInterface $url
+     * @param RequestException $requestException
+     * @param UriInterface|null $foundOnUrl
+     */
+    public function crawlFailed(
+        UriInterface $url,
+        RequestException $requestException,
+        ?UriInterface $foundOnUrl = null
+    ) {
+    }
+
+    /**
+     * Called when the crawl has ended.
+     */
+    public function finishedCrawling()
+    {
+        $this->storage->setValue('sizeOfPageTree', $this->sizeOfPageTree);
+        $this->storage->setValue('quantityOfWords', $this->quantityOfWords);
+    }
+}

